import React from 'react';
import ReactDOM from 'react-dom';
import App from "./components/App";

function Card(props) {
  console.log(props);

  return (
    <div className="my-style">
      <h2>{props.name}</h2>
      <img
        src={props.img}
        alt=""
      />
      <p>{props.tel}</p>
      <p>{props.email}</p>
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
